// Noto Sans CJK has many more steps defined but they're not shipped with Android yet.

const notoCJKWeights = {
  regular: {
    includeFontPadding: false,
    fontFamily: "sans-serif",
    fontWeight: "normal",
    backgroundColor: "transparent"
  },
  bold: {
    includeFontPadding: false,
    fontFamily: "sans-serif",
    fontWeight: "bold",
    backgroundColor: "transparent"
  }
};

export default notoCJKWeights;
